    "quotes": "Un troupeau de moutons ne peut se déplacer qu'à la vitesse du mouton le plus lent.Quand le troupeau est pourchassé, ce sont les plus lents et les plus faibles qui sont attaqués en premier. Cette sélection naturelle est bonne pour le troupeau en général, parce que la vitesse du troupeau augmente à mesure que les plus lents et les plus faibles sont éliminés. De la même façon, le cerveau humain ne peut fonctionner plus vite que ses cellules les plus lentes. Comme on le sait aujourd'hui, la consommation d'alcool détruit les cellules du cerveau. Naturellement ce sont les cellules les plus les lentes et les plus faibles qui sont détruites en premier. On peut donc en déduire qu'une consommation d'alcool élimine les cellules les plus faibles, rendant ainsi notre cerveau de plus en plus performant. Ce qui explique pourquoi on se sent toujours un peu plus intelligent après 4 ou 5 apéros. \n\nLa théorie du Mouton.",
