    "quotes": "« Ward la voit autour de lui qui forme des collines. Comme des montagnes qui déferlent ces pentes bleues de liquide, et aucune idée de la manière dont elles vont tomber ou se dresser, elles sont simplement sur vous accourues de toutes parts pour vous capturer, comme une gigantesque prison aquatique et la planche doit trouver un moyen d’en sortir, d’une façon ou d’une autre, un moyen de se projeter par-dessus, de franchir ce mur. C’est avec tout ton corps que tu surfes, c’est sûr, comme son père l’a toujours dit, mais ça…Comment utiliser ton corps là-dedans…La mer est le seule corps. »\n\n\"Les passions sont les vents qui enflent les voiles du navire ; elles le submergent quelquefois, mais sans elles il ne pourrait voguer.\"\n\n\"Les hommes sont des insectes se dévorant les uns les autres sur un petit atome de boue.\"\n\n\"C'est ça leur destin - voir disparaitre tout ce qu'on croyait perpetuel, puis disparaitre à son tour, de façon aussi absurde. Faire l'amour avec le néant jusqu'à deveni le néant. Mais dans l'intervalle, vivre intensément, vivre jusqu'à l'extase, chaque émotion puisée dans sa propre destruction.\"\n\n\" On meurt et reviens à la vie à chaque battement de coeur : ton coeur fait boup-boup, tu es vivant, mais, durant l'infime silence occulte qui sépare les deux boup, tu es mort - je m'accroche à cette vision du morceau de viande boup-boupant dans le côté gauche de ma poitrine.\"\n\n\" 'Mais cela ne fait rien, parce que même si je ne suis pas moi-même plus très sûr de savoir qui je suis, je suis sûr au moins de ne pas être celui qu'ils pensent \"\n\n\"Adamsberg était docile, il avait tendance à coucher avec toutes les filles qui en avaient envie, et parfois ça lui semblait vraiment la bonne chose à faire puisque ça avait l'air de faire plaisir à tout le monde, et parfois ça lui semblait vain\"",
