    "quotes": "La musique adoucit les moeurs!!! Oui....mais seulement la bonne musique.\nCe n'est pas parce que les choses sont difficiles que nous n'osons pas, mais parce que nous n'osons pas qu'elles le sont.\nJ'ai décidé d'être heureux parce que c'est bon pour la santé.\nTant de mains pour transformer ce monde, et si peu de regards pour le contempler.\nIl ne faut pas de tout pour faire un monde, il faut du bonheur et rien d'autre.\nN'essayez pas de devenir un Homme qui a du succès.Essayez de devenir un Homme qui a de la valeur.\nLorsque l'Homme aura coupé le dernier arbre, pollué la dernière goutte d'eau, tué le dernier animal et pêché le dernier poisson, alors il se rendra compte que l'argent n'est pas comestible.\nLa seule chose qui ne changera jamais, c'est que tout est toujours en train de changer.\nLe seul péché est de ne pas se risquer pour vivre son désir.\nIl ya deux tragédies dans la vie. La première est de ne pas réaliser ses rêves, l'autre est de les réaliser.\nSourir 3 fois par jour rend inutile tout médicament.\nLa vie est un rêve, mais rêver n'est pas vivre.\nLes choses que l'on possède finissent par nous posséder.\nLe bonheur n'est réel que lorsqu'il est partagé.\nLa musique est la bande son de notre vie ( Music is the sountrack of our life )\nLes mauvaises nouvelles, je pourrais les apprécier si je les écoutais en musique.\nCe qui caractérise notre époque c'est la perfection des moyens et la confusion des fins.\nL'amour parle, même à lèvres closes.\nLe temps n'est jamais perdu s'il est donné aux autres.",
